import React, { useCallback }  from 'react';
import { Card, Avatar, Row, Col, Select, Input } from 'antd';
import { EditOutlined, EllipsisOutlined, SettingOutlined, AudioOutLined } from '@ant-design/icons';
const { Meta } = Card;
import styled from 'styled-components';

const { Option } = Select;
const { Search } = Input;

const children = [];
for (let i = 10; i < 36; i++) {
    children.push(<Option key={i.toString(36) + i}>{i.toString(36) + i}</Option>);
}

const AppDiv = styled.div`
    width: 80%;
    margin: 0 auto;
    padding: 1rem;
`;

const AppBlock = styled.div`
  margin: 0 auto;
  margin-top: 2rem;
  border: 1px solid black;
  padding: 1rem;
`;

function handleChange(value) {
    console.log(`Selected: ${value}`);
}

const onSearch = value => console.log(value);

const ShopList = () => {
    return (
        <>
        <AppDiv>
            <Select size='default' defaultValue="a1" onChange={handleChange} style={{ width: 200 }}>
                {children}
            </Select>
            <Search placeholder="input search text" allowClear onSearch={onSearch} style={{ width: 200 }} />
            <AppBlock>
                <Row gutter={[16,16]}>
                    <Col span={4.5}>
                        <Card
                            style={{ width: 300}}
                            cover={
                                <img
                                    alt="example"
                                    src="https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png"
                                />
                            }
                            actions={[
                                <SettingOutlined key="setting" />,
                                <EditOutlined key="edit" />,
                                <EllipsisOutlined key="ellipsis" />,
                            ]}
                        >
                            <Meta
                                avatar={<Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />}
                                title="Card title"
                                description="This is the description"
                            />
                        </Card>
                    </Col>
                    <Col span={4.5}>
                        <Card
                            style={{ width: 300}}
